query:
/*+ NoHashJoin(mi_idx t) NoNestLoop(mi_idx t ci) */ select count(*)
from movie_info_idx AS mi_idx
inner join title AS t
on t.id = mi_idx.movie_id AND mi_idx.info_type_id > 100 AND t.production_year < 2012
inner join cast_info AS ci
on t.id = ci.movie_id AND ci.person_id > 2308469 AND ci.role_id > 2;
